import React from 'react';

export default function Task({ task }){
  return (
    <div style={{
      border: `1px solid lightgrey`,
      borderRadius: `2px`,
      padding: `8px`,
      marginBottom: `8px`
    }}>
      {task.content}
    </div>
  );
}
